import React, { Component } from 'react';

import './backgroundStyle.css';


import {
    Link
}from 'react-router-dom';





class Background extends Component {
    render() {
        return(
           <video
        autoPlay
        muted
        loop
        style={{
          position: "fixed",
          width: "100%",
          left: 0,
          top: 0
        }}
      >
        <source src="backgroundVideo" type="video/mp4" />
      </video>
        );
    }
}

export default Background;
